const Try = () => {
    // var name="zain";
    var [name2,setName]= useState("rauf");
    
    
    const changeName=()=>{
        console.log("Entered Funcitons");
        if (name2=="rauf"){
            setName("usama");
        }
        else{
            setName("rauf");
        }
        // setName("usama");
    }
    
    return (
        <>
            <h1 onClick={changeName}>{name2}</h1>
        </>
    )
}

